// import logo from './logo.svg';
import './App.css';
import GreetClassComponent from './components/GreetClassComponent';
import { SumaClassComponent } from './components/SumaClassComponent';
import WelcomeFunctionalComponent from './components/WelcomeFunctionalComponent';


function App() {
  return (
    <div className="App">
      <WelcomeFunctionalComponent name="sanjay"/>
      <GreetClassComponent/>
      <SumaClassComponent name="sanjay"/>
    </div>
  );
}

export default App;
